import Delete from '@material-ui/icons/Delete';
const List = (props) => {
  return (
    <div className="todo_style">
      <span onClick={cutIt}>
        <Delete className="dltIcon" />
      </span>
      <li style={{ textDecoration: 'line-through' }}>{props.text}</li>
    </div>
  );
};

export default List;
